// src/components/UploadActivities.js
import React from 'react';

const UploadActivities = () => {
  return (
    <div style={{
      backgroundImage: 'url(https://example.com/your-image.jpg)', 
      backgroundSize: 'cover', 
      height: '400px', 
      display: 'flex', 
      justifyContent: 'center', 
      alignItems: 'center',
    }}>
      <h1 style={{ color: '#FFF' }}>Upload Your Activities</h1>
    </div>
  );
};

export default UploadActivities;
